import React, {Component} from 'react';
import './photo.css';

class Photo extends Component{
  constructor(props) {
    super(props);
  }

  render(){
    return(
      <img src={this.props.src} alt="photo" className="rounded img-fluid"/>
    );
  }
}

export default Photo;
